Writing code for HTTP parameter pollution can be a bit risky, as it often involves manipulating requests in ways that can compromise security. However, explaining how it works in theory can be educational. Parameter pollution occurs when multiple parameters with the same name are sent in an HTTP request. Some servers might concatenate these values or only take the first or the last one, which can lead to unexpected behavior.

Here's a simple JavaScript example to demonstrate how you might craft a request:

```javascript
const http = require('http');

const options = {
  hostname: 'example.com',
  port: 80,
  path: '/vulnerable-endpoint?param=value1&param=value2',
  method: 'GET'
};

const req = http.request(options, (res) => {
  console.log(`Status: ${res.statusCode}`);
});

req.on('error', (error) => {
  console.error(error);
});

req.end();
```

This example sends a GET request to `example.com` with the endpoint including two `param` parameters. How the server handles these may vary, and if it has input validation or a web application firewall (WAF) not properly configured, it could lead to bypassing those protections.

